import React from 'react';
import { useNavigate } from 'react-router-dom';

const logoUrl = 'http://localhost:4000/images/Deliver_Deli.jpeg';

const LandingPage = () => {
  const navigate = useNavigate();
  return (
    <div style={{ minHeight: '100vh', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', background: '#f4f6fb' }}>
      <img src={logoUrl} alt="DeliverDeli Logo" style={{ width: 100, height: 100, borderRadius: 20, marginBottom: 24, boxShadow: '0 2px 12px rgba(34,34,59,0.10)' }} />
      <h1 style={{ fontSize: 38, fontWeight: 800, color: '#fca311', marginBottom: 8 }}>DeliverDeli</h1>
      <p style={{ fontSize: 20, color: '#22223b', marginBottom: 32 }}>Sign up or log in to start your food journey!</p>
      <div style={{ display: 'flex', gap: 20 }}>
        <button style={{ background: '#fca311', color: '#22223b', border: 'none', borderRadius: 20, padding: '0.7rem 2.2rem', fontWeight: 700, fontSize: 18, boxShadow: '0 2px 8px rgba(252,163,17,0.13)' }} onClick={() => navigate('/login')}>Login</button>
        <button style={{ background: '#22223b', color: '#fff', border: 'none', borderRadius: 20, padding: '0.7rem 2.2rem', fontWeight: 700, fontSize: 18, boxShadow: '0 2px 8px rgba(34,34,59,0.13)' }} onClick={() => navigate('/signup')}>Signup</button>
      </div>
    </div>
  );
};

export default LandingPage;
